function URLRes(){this.myUrl=this.getMyUrl();this.fromUrl=this.getFromUrl()}URLRes.prototype.getMyUrl=function(){var a=document.createElement("a");a.href=document.URL;return{url:a.href,hostname:a.hostname,path:a.pathname.replace(/^([^\/])/,"/$1"),query:a.search,hash:a.hash.replace("#",""),params:(function(){var d={},c=a.search.replace(/^\?/,"").split("&"),b=c.length,e=0,f;for(;e<b;e++){if(!c[e]){continue}f=c[e].split("=");d[f[0]]=f[1]}return d})()}};URLRes.prototype.getFromUrl=function(){var a=document.createElement("a");a.href=document.referrer;return{url:a.href,hostname:a.hostname,path:a.pathname.replace(/^([^\/])/,"/$1"),query:a.search,hash:a.hash.replace("#",""),params:(function(){var d={},c=a.search.replace(/^\?/,"").split("&"),b=c.length,e=0,f;for(;e<b;e++){if(!c[e]){continue}f=c[e].split("=");d[f[0]]=f[1]}return d})()}};